    const double c1_1_0_6 = w[1][6];
    const double c1_1_0_7 = w[1][7];
    const double c4_3_0_0 = w[4][0];
    const double c5_3_1_0 = w[5][0];
    const double c1_3_2_0 = w[1][0];
